import React, { useState } from "react";
import styles from "./Slider.module.css";

const Slider = props => {
  const [currentImage, setCurrentImage] = useState(1);
  return (
    <div className={styles.slider}>
      <div className={styles.slider__left}></div>
      <div className={styles.slider__center}>
        <div className={styles.slider__center_inner}>
          <div className={styles.center_inner__image}>
            <img src="/static/images/slider/Photo-1.jpg" alt="Photo-1" />
          </div>
          <div className={styles.center_inner__buttons}>
            <div className={styles.buttons__prev}>
              <img src="/static/images/arrow.png" alt="prev" />
            </div>
            <div className={styles.buttons__next}>
              <img src="/static/images/arrow.png" alt="next" />
            </div>
          </div>
        </div>
      </div>
      <div className={styles.slider__right}></div>
    </div>
  );
};

export default Slider;
